import()

func isRepeat(anss [][]int, ans []int) bool{
	
	for s := range(anss){
		flag := false
		for i := 0 ; i < len(ans); i ++{
			if anss[s][i] != ans[i]{
				flag = true
				break
			} 
		}
		if !flag {
			return true
		}
	}

	return false
}

func threeSum(nums []int) [][]int {
	
	anss := [][]int{}
	
	// 排序nums,从小到大
	t := nums

	for i := 0 ; i < len(t) ; i ++{
		for j := i + 1 ; j < len(t); j ++{
			if t[i] >= t[j] {
				t[i],t[j] = t[j],t[i]
			}
		}
	}

	for i := 0 ; i < len(t); i ++{
		j := i + 1 
		k := len(t) - 1
		for k > j {
			if t[i] + t[j] + t[k] < 0 {
				j += 1
				continue
			}

			if t[i] + t[j] + t[k] > 0{
				k -= 1
				continue
			}

			if t[i] + t[j] + t[k] == 0 {
				if !isRepeat(anss , []int{t[i],t[j],t[k]}){
					anss = append(anss, []int{t[i],t[j],t[k]})
				}

				for j < k && t[j] == t[j+1] {
					j += 1
				}
				j += 1
			}
			
		}
	}
	


	return anss
}

